import React from 'react';
import {Link} from 'react-router-dom';
function Navbar(){
  return (
    <ul>
        <li><Link to='/'>Home</Link></li>
        <li><Link to='/kontakt'>Kontakt</Link></li>
        <li><Link to='/oferta'>Oferta</Link></li>
    </ul>
  );
};
  
export default Navbar;
